I remember the first time I laid eyes on The Long Waterman Mansion in Bankers Hill... I was in 11th grade about to graduate and I had a friend who knew I was new to SD and knew how much i loved vintage architecture so as a graduation gift he drove me around Down Town and Bankers Hill to look at houses.. but when I saw this beautiful 1889 Queen Anne Victorian Mansion, I quickly made him stop!! She literally took my breath away, and I fell in love. I’ve  always had a deep love and passion for Victorian architecture but this one became my favorite. So throughout the years I would often cruise by and take her picture.. And with every car I’d get , when I first started driving Benny and with my motorcycles id always cruise by and admire her beauty and elegance😍. So when I was thinking of a spot for this shoot, she came to mind!! And I’m so glad she did, because it was just perfection to have her exquisite beauty in these photographs, and with @_payyo54_  classy 54 Ford Mercury.. just wow. 😍🤩
@twistedfatephotography  captured so many amazing shots!! So talented! Thank you so much you guys so in love ❤️📸😍

